Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT  ?x
WHERE {
  ns:m.0fjp3 ns:sports.sports_championship.events ?x . # World Series
  {
    { ?x ns:sports.sports_championship_event.runner_up ns:m.01yhm . } # Cleveland Indians
    UNION
    { ?x ns:sports.sports_championship_event.champion ns:m.01yhm . } # Cleveland Indians
  }
  ?x ns:time.event.start_date ?d .
}
